import React from 'react';

const About = () => {
  return (
    <section id="about" className="about">
      <div className="container">
        <h2>About ATELIER BOTANICA</h2>
        <p>
          We are dedicated to creating beautiful outdoor spaces that enhance your property's
          value and curb appeal. With years of experience in landscape design, construction,
          and maintenance, we bring your vision to life.
        </p>
      </div>
    </section>
  );
};

export default About;
